rawItems.forEach(function (str) {
    var strPieces = str.split('|');

    var obj = {};

    var i = 0;
    for (var attr in fields) {
        if (fields[attr] === "INTEGER") {
            obj[attr] = NumberLong(parseInt(strPieces[i]));
        } else if (fields[attr] == "TEXT") {
            obj[attr] = strPieces[i];
        } else if (fields[attr] == "REAL") {
            obj[attr] = parseFloat(strPieces[i]);
        }
        i++;
    }

    db.Item.insert(obj);
});
